// --- Funciones para guardar y cargar tipos de vehículos registrados ---
function guardarTiposVehiculosRegistrados() {
  localStorage.setItem('tiposVehiculos', JSON.stringify(tiposVehiculosRegistrados));
}

function cargarTiposVehiculosRegistrados() {
  const storedTipos = localStorage.getItem('tiposVehiculos');
  if (storedTipos) {
    Object.assign(tiposVehiculosRegistrados, JSON.parse(storedTipos));
  }
}

// --- Funciones para guardar y cargar configuraciones de tarifas ---
function guardarTarifas() {
    localStorage.setItem('TARIFAS', JSON.stringify(TARIFAS));
    localStorage.setItem('MAX_TIEMPO_TARIFA_PLENA', MAX_TIEMPO_TARIFA_PLENA.toString());
}

function cargarTarifas() {
    const storedTarifas = localStorage.getItem('TARIFAS');
    const storedMaxTiempo = localStorage.getItem('MAX_TIEMPO_TARIFA_PLENA');

    if (storedTarifas) {
        Object.assign(TARIFAS, JSON.parse(storedTarifas));
    }
    if (storedMaxTiempo) {
        MAX_TIEMPO_TARIFA_PLENA = parseInt(storedMaxTiempo);
    }
}

