// --- NUEVA FUNCIÓN: Cargar configuración de tarifas en la interfaz del admin ---
function loadAdminProfileSettings() {
    if (motoPorSegundoInput) { // Verificar si los elementos existen (solo para admin)
        // Convertir de costo por segundo a costo por hora para mostrar
        motoPorSegundoInput.value = (TARIFAS.moto.porSegundo * 3600).toFixed(2);
        motoTarifaPlenaInput.value = TARIFAS.moto.tarifaPlena;
        motoTiempoTarifaPlenaInput.value = TARIFAS.moto.tiempoTarifaPlena / 3600;

        automovilPorSegundoInput.value = (TARIFAS.automovil.porSegundo * 3600).toFixed(2);
        automovilTarifaPlenaInput.value = TARIFAS.automovil.tarifaPlena;
        automovilTiempoTarifaPlenaInput.value = TARIFAS.automovil.tiempoTarifaPlena;
        automovilTiempoTarifaPlenaInput.value = TARIFAS.automovil.tiempoTarifaPlena / 3600;


        camionPorSegundoInput.value = (TARIFAS.camion.porSegundo * 3600).toFixed(2);
        camionTarifaPlenaInput.value = TARIFAS.camion.tarifaPlena;
        camionTiempoTarifaPlenaInput.value = TARIFAS.camion.tiempoTarifaPlena / 3600;

        maxTiempoTarifaPlenaInput.value = MAX_TIEMPO_TARIFA_PLENA / 3600;
    }
}

// --- NUEVA FUNCIÓN: Guardar configuración de tarifas desde la interfaz del admin ---
function saveTariffSettings() {
    try {
        // Convertir de costo por hora (entrada del usuario) a costo por segundo (para cálculos)
        TARIFAS.moto.porSegundo = parseFloat(motoPorSegundoInput.value) / 3600;
        TARIFAS.moto.tarifaPlena = parseFloat(motoTarifaPlenaInput.value);
        TARIFAS.moto.tiempoTarifaPlena = parseFloat(motoTiempoTarifaPlenaInput.value) * 3600;

        TARIFAS.automovil.porSegundo = parseFloat(automovilPorSegundoInput.value) / 3600;
        TARIFAS.automovil.tarifaPlena = parseFloat(automovilTarifaPlenaInput.value);
        TARIFAS.automovil.tiempoTarifaPlena = parseFloat(automovilTiempoTarifaPlenaInput.value) * 3600;

        TARIFAS.camion.porSegundo = parseFloat(camionPorSegundoInput.value) / 3600;
        TARIFAS.camion.tarifaPlena = parseFloat(camionTarifaPlenaInput.value);
        TARIFAS.camion.tiempoTarifaPlena = parseFloat(camionTiempoTarifaPlenaInput.value) * 3600;

        MAX_TIEMPO_TARIFA_PLENA = parseFloat(maxTiempoTarifaPlenaInput.value) * 3600;

        guardarTarifas(); // Persistir en localStorage
        alert('Configuraciones de tarifas guardadas exitosamente.');
    } catch (error) {
        alert('Error al guardar las tarifas. Asegúrate de que los valores sean numéricos válidos.');
        console.error('Error al guardar tarifas:', error);
    }
}


// --- NUEVA FUNCIÓN: Verificar Placa en Mensualidades ---
function checkPlacaMensualidad() {
    const placa = placaMensualidadInput.value.trim().toUpperCase();
    let foundMensualidad = null;

    if (placa === '') {
        // Limpiar campos si la placa está vacía
        clienteInput.value = '';
        tipoMensualidadSelect.value = 'automovil'; // Restablecer a valor por defecto
        return;
    }

    // Buscar la placa en las mensualidades existentes
    foundMensualidad = mensualidades.find(m => m.placa === placa);

    if (foundMensualidad) {
        // Si se encuentra una mensualidad para la placa, precargar los datos
        clienteInput.value = foundMensualidad.cliente;
        tipoMensualidadSelect.value = foundMensualidad.tipo;
    } else {
        // Si la placa no está registrada, limpiar los campos (excepto la placa)
        clienteInput.value = '';
        tipoMensualidadSelect.value = 'automovil'; // Restablecer a valor por defecto
    }
}


// --- Funciones de Login y Navegación ---
function login() {
  const user = document.getElementById("username").value.trim();
  const pass = document.getElementById("password").value.trim();
  const loginErrorDiv = document.getElementById("login-error");

  loginErrorDiv.innerText = ""; // Limpiar mensajes de error anteriores

  // Intento de login como Administrador
  if (user.toLowerCase() === "admin" && pass === "1234") {
    usuarioActual = "admin";
    mostrarAdmin();
    return;
  }

  // Intento de login como Cliente
  if (usuariosClientes.hasOwnProperty(user.toUpperCase())) { // Convertir a mayúsculas para comparar con placas
    if (usuariosClientes[user.toUpperCase()] === pass) {
      usuarioActual = user.toUpperCase(); // El usuario es la placa
      mostrarCliente(user.toUpperCase());
      return;
    }
  }

  // Si no es ni admin ni cliente válido
  loginErrorDiv.innerText =
    "Credenciales incorrectas. Para admin: usuario admin y clave 1234. Para clientes: usa tu placa como usuario y tu contraseña.";
}

