// --- Funciones de PDF ---
function numeroALetras(num) {
  const unidades = ['', 'UN', 'DOS', 'TRES', 'CUATRO', 'CINCO', 'SEIS', 'SIETE', 'OCHO', 'NUEVE'];
  const especiales = ['DIEZ', 'ONCE', 'DOCE', 'TRECE', 'CATORCE', 'QUINCE', 'DIECISÉIS', 'DIECISIETE', 'DIECIOCHO', 'DIECINUEVE'];
  const decenas = ['', '', 'VEINTE', 'TREINTA', 'CUARENTA', 'CINCUENTA', 'SESENTA', 'SETENTA', 'OCHENTA', 'NOVENTA'];
  const centenas = ['', 'CIENTO', 'DOSCIENTOS', 'TRESCIENTOS', 'CUATROCIENTOS', 'QUINIENTOS', 'SEISCIENTOS', 'SETECIENTOS', 'OCHOCIENTOS', 'NOVECIENTOS'];

  function convertirGrupo(n) {
    let res = '';
    if (n >= 100) {
      res += centenas[Math.floor(n / 100)];
      n %= 100;
      if (res === 'CIENTO' && n === 0) res = 'CIEN';
    }
    if (n >= 20) {
      res += (res ? ' ' : '') + decenas[Math.floor(n / 10)];
      n %= 10;
    }
    if (n >= 10 && n < 20) {
      res += (res ? ' ' : '') + especiales[n - 10];
      n = 0;
    }
    if (n > 0) {
      res += (res ? ' ' : '') + unidades[n];
    }
    return res;
  }

  let parteEntera = Math.floor(num);
  let resultado = '';

  if (parteEntera === 0) {
    resultado = 'CERO';
  } else {
    let millones = Math.floor(parteEntera / 1000000);
    parteEntera %= 1000000;
    let miles = Math.floor(parteEntera / 1000);
    parteEntera %= 1000;

    if (millones > 0) {
      resultado += (millones === 1 ? 'UN MILLÓN' : convertirGrupo(millones) + ' MILLONES');
    }
    if (miles > 0) {
      resultado += (resultado ? ' ' : '') + (miles === 1 ? 'MIL' : convertirGrupo(miles) + ' MIL');
    }
    if (parteEntera > 0) {
      resultado += (resultado ? ' ' : '') + convertirGrupo(parteEntera);
    }
  }

  return resultado.trim() + ' PESOS M/CTE';
}

